      pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1721542","type":"CustomJS"},{"attributes":{"axis":{"id":"1721199"},"coordinates":null,"group":null,"ticker":null},"id":"1721202","type":"Grid"},{"attributes":{"days":["%d %b","%a %d"],"months":["%m/%Y","%b'%y"]},"id":"1721228","type":"DatetimeTickFormatter"},{"attributes":{"line_alpha":0.2,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.045746401}},"id":"1721353","type":"Line"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"1721225"}},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"top":{"field":"Open"},"width":{"value":0.8},"x":{"field":"index"}},"id":"1721494","type":"VBar"},{"attributes":{"axis_label":"Profit / Loss","coordinates":null,"formatter":{"id":"1721426"},"group":null,"major_label_policy":{"id":"1721576"},"minor_tick_line_color":null,"ticker":{"id":"1721390"}},"id":"1721389","type":"LinearAxis"},{"attributes":{"f
